import React from 'react';
import './card.styles.css';

export const Card = props => {
    return (
    <div className="card-container">
        <img alt="monster" src={`https://robohash.org/${props.monster.id}?set=set2&size=180x150`} />
        <h1><b>{props.monster.name}</b></h1>
        </div>
    )
}

export default Card;
